import React from "react";
import Link from "next/link";

import { Menu, Button } from "antd";

const Nav = ({ categories }) => {
  return (
    <Menu mode="horizontal">
      <Link href="/">
        <Menu.Item key="mail" icon={<MailOutlined />}>
          Home
        </Menu.Item>
      </Link>
      <Link href="/about">
        <Menu.Item key="mail" icon={<AppStoreOutlined />}>
          About
        </Menu.Item>
      </Link>
    </Menu>
  );
};

export default Nav;

